import Link from 'next/link'

const Menu = () => {

    return (

        <div>
            <Link href="/">Home</Link>&nbsp;|&nbsp;
            <Link href="/quemSomos">Quem somos</Link>&nbsp;|&nbsp;
            <br /><br />
        </div>

    )

}

export default Menu
